import Vue from 'vue';
import Router from 'vue-router';
import Home from './views/Home.vue';
import AddData from './views/AddData.vue';

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: '/',
      name: 'Home',
      component: Home,
    },
    {
      path: '/add',
      name: 'AddData',
      component: AddData,
    },
  ],
});
